import React from 'react';
import { useState, useEffect } from "react";
import Axios from "axios";

import { Route, Routes } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import MainHeader from './Components/MainHeader';
import outside from './outside.mp4';

import './App.css';

import Home from './Components/Home';
import About from './Components/About';
import Contact from './Components/Contact';
import BecomeaHost from './Components/BecomeaHost';
import FindaGroup from './Components/FindaGroup';
import Login from './Components/Login';
import SignUp from './Components/SignUp';
import {Container} from 'react-bootstrap';
import Thankyouone from './Components/Thankyouone';
import Thankyoutwo from './Components/Thankyoutwo';
import Admindashboard from './Components/Admindashboard';


import Explorers from './Explorers.PNG';
import ExplorerHome from './ExplorerHome.png';
import tree from './tree.png';

console.log(Explorers);
console.log(ExplorerHome);
console.log(tree);
console.log(outside);

function App()
{
  const [members, setMembers] = useState([]);
  const getMembers = () => {
    Axios.get("http://localhost:3000/members").then((res) => {
      setMembers(res.data);
    });
  };


  useEffect(() => {
    getMembers();
}, [members]);


  return (
    <div className="App">
          <header className="App-header">

          <video width="100%" height="100%" autoPlay loop defaultMuted playsInline muted>
            <source src={outside} type="video/mp4"/>
          </video>

          <MainHeader />
        </header>
        <Add members={members} setMembers={setMembers} />
        <div className="members">
        {members.map((item) => {
          return (
            <div className="review">
              <h3>Username: {item.username}</h3>
              <h3>Password: {item.password}</h3>
              <h3>First Name: {item.mbrfirstname}</h3>
              <h3>Last Name: {item.mbrlastname}</h3>

            </div>
          );
        })};
      <main fluid>
        <Routes>
          <Route path='/Home' element={<Home />} />
          <Route path='/About' element={<About />} />
          <Route path='/BecomeaHost/' element={<BecomeaHost />} />
          <Route path='/Contact/' element={<Contact />} />
          <Route path='/FindaGroup/' element={<FindaGroup />} />
          <Route path='/Login/' element={<Login />} />
          <Route path='/SignUp/' element={<SignUp />} />
          <Route path='/Thankyouone/' element={<Thankyouone />} />
          <Route path='/Thankyoutwo/' element={<Thankyoutwo />} />
          <Route path='/Admindashboard/' element={<Admindashboard />} />
        </Routes>
      </main>


        <div className="color-nav" style={{display: "flex", alignItems:'center',height: "30px"}}>
              <Container >
                <footer className="color-nav" >
                    © Teeny Tiny Explorers 2021

                </footer>
              </Container>
          </div>
        </div>
        </div>
  );
}



export default App;
